export default function Home() {
  return (
    <Box>
      <HeroSection />
      <FeatureStrip />
      <Box sx={{ px: 2, py: 2 }}>
        <PopularDestinations />
        <TopSellingPackages />
      </Box>
    </Box>
  );
}
